description:
增加动态加载外部dll支持
 public static class AppDomainExtension
    {
        public static void InitLoadAssembly(this AppDomain appDomain, string dynamicLibFullDir)
        {
            AssemblyFileResolveWrap assemblyFileResolveWrap = new AssemblyFileResolveWrap(dynamicLibFullDir);
            assemblyFileResolveWrap.InitLoadAssembly(appDomain);
        }
        public static Assembly LoadAssembly(this string loadDllPath)
        {
            var dependAssembly = Assembly.LoadFrom(loadDllPath);
            return dependAssembly;
        }
    }

